import React, { Component } from 'react'
import { Link } from 'react-router-dom';
import Question from './Question';

class Survey extends Component {
    
    constructor(props) {
        super(props)
    
        this.state = {
             x: 10
        }
    }

    
    render() {
        return (
            <div>
                <div>
                    <h1>Survey</h1>
                </div>

                <Link to='/homepage'>
                    <div>Home</div>
                </Link>

                <Question id="question-1" content="Have any papers been filed in this matter?"></Question>
                {this.state.x > 0 && (
                    <div>
                        {this.state.x}
                    </div>
                )}
                <Question id="question-2" content=""></Question>
            </div>
        )
    }
}

export default Survey
